import React from 'react';

const Top5Pools = ({ pools }) => {
  return (
    <div>
      <h2>Top 5 Pools</h2>
      <ul>
        {pools.map((pool) => (
          <li key={pool.id}>
            {pool.name}: {pool.volume}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Top5Pools;
